import React from 'react'

function Footer()
{
    return(
       <React.Fragment>
     <div className="foot">
             
             <a href="https://www.linkedin.com/in/YOUR-LINKEDIN-USERNAME" target="_blank">
       <img src="https://cdn-icons-png.flaticon.com/512/174/174857.png" alt="LinkedIn" width="30"></img>
         </a>
            </div>
       </React.Fragment>     
    )
}
export default Footer;
